        private static async Task DoVAHTextTesting(int requestId) 
        {
            using (var client = new HttpClient()) 
            {
                Console.WriteLine($"Request {requestId} started");
                
                try
                {
                    var watch = System.Diagnostics.Stopwatch.StartNew();
                    //var url = "http://virtualagenthub-na1.mediaservices.staging.internal/v1/virtualagents/requestbotexchange";
                    //var url = "http://localhost:19525/v1/virtualagents/requestbotexchangeasync";
                    //var url = "http://localhost:19525/v1/virtualagents/requestbotexchange_sync";
                    var url = "http://localhost:19525/v1/VirtualAgentAsync/requestbotexchangeasync";
                    //var url = "http://localhost:19521/v1/virtualagents/requestbotexchange";
                    //var url = "http://virtualagenthub-na1.mediaservices.staging.internal/v1/VirtualAgentAsync/requestbotexchangeasync";
                    var jsontext = await File.ReadAllTextAsync(@"C:\Users\ajindal\source\repos\LexLoadTesting\LexLoadTesting\Data\LexVoice.Json");
                    //var jsontext = await File.ReadAllTextAsync(@"C:\Users\ajindal\source\repos\LexLoadTesting\LexLoadTesting\Data\Azure.Json");
                    dynamic jsonObject = JsonConvert.DeserializeObject(jsontext);
                    jsonObject.executionInfo.contactId = "122" + requestId;
                    jsontext = JsonConvert.SerializeObject(jsonObject);
                    var data = new StringContent(jsontext, Encoding.UTF8, "application/json");

                    CancellationTokenSource cancelSource = new CancellationTokenSource(TimeSpan.FromSeconds(600));
                    CancellationToken cancelationToken = cancelSource.Token;
                    client.Timeout = TimeSpan.FromSeconds(10000);
                    var response = await client.PostAsync(url, data, cancelationToken);
                    var sResponse = await response.Content.ReadAsStringAsync();

                    BotExchangeResponse responsejsonObject = JsonConvert.DeserializeObject<BotExchangeResponse>(sResponse);

                    watch.Stop();
                    Console.WriteLine($" output {responsejsonObject.nextPromptSequence.prompts[0].transcript} : outputTime - {watch.ElapsedMilliseconds/1000}"
                    );
                }
                catch (Exception ex)
                {

                    Console.WriteLine($"Error while fetching data request number {requestId}  | Error {ex.Message}");
                }
            }
            
        }

        private static readonly TaskFactory _taskFactory = new
          TaskFactory(CancellationToken.None,
                      TaskCreationOptions.None,
                      TaskContinuationOptions.None,
                      TaskScheduler.Default);

        public static TResult RunSync<TResult>(Func<Task<TResult>> task)
           => _taskFactory
               .StartNew(task)
               .Unwrap()
               .GetAwaiter()
               .GetResult();

